using System.Runtime.CompilerServices;
using System.Runtime.InteropServices;

var longS =
	"";


var longT =
	"";

var inputs = new List<(string s, string t)>
{
	(s: "BRQPBFAGCRTM", t: "ABC"),
	(s: "a", t: "aa"),
	(s: "aaa", t: "aa"),
	(s: "ababababac", t: "abc"),
	(s: "ADOBECODEBANC", t: "ABC"),
	(s: longS, t: longT),
};

var it = new Solution();
foreach (var (s, t) in inputs)
{
	Console.WriteLine($"Result ({s}, {t}): '{it.MinWindow(s, t)}'");
}

public class Solution
{
	public string MinWindow(string s, string t)
	{
		if (t.Length == 0)
			return "";

		var sArray = s.ToCharArray();

		string? result = null;

		var tCountsMapSnapshot = t.ToArray().GroupBy(it => it).ToDictionary(it => it.Key, it => it.Count());
		var tCountsMap = new Dictionary<char, int>(tCountsMapSnapshot);
		var uniqueKeysSnapshot = tCountsMapSnapshot.Keys.ToHashSet();
		
		for (var searchStart = 0; searchStart < sArray.Length; searchStart++)
		{
			foreach (var key in tCountsMap.Keys)
				tCountsMap[key] = tCountsMapSnapshot[key];

			var uniqueKeys = new HashSet<char>(uniqueKeysSnapshot);
			
			int? firstEncounterIndex = null;
			int? secondEncounterIndex = null;

			for (var index = searchStart; index < sArray.Length; index++)
			{
				var sChar = sArray[index];

				ref int charCounter = ref CollectionsMarshal.GetValueRefOrNullRef(tCountsMap, sChar);
				var exists = !Unsafe.IsNullRef(ref charCounter);
				if (exists)
				{
					if (firstEncounterIndex is null)
						firstEncounterIndex = index;
					else if (secondEncounterIndex is null)
						secondEncounterIndex = index;
				}

				if (exists && charCounter > 0)
				{
					charCounter--;
					if (charCounter == 0)
						uniqueKeys.Remove(sChar);

					if (uniqueKeys.Count == 0)
					{
						var firstEncounterIndexValue = firstEncounterIndex!.Value;
						var length = index - firstEncounterIndexValue;
						if (result is null || length < result.Length)
							result = new string(sArray.Skip(firstEncounterIndexValue).Take(length + 1).ToArray());

						searchStart = secondEncounterIndex is { } second
							? second - 1
							: firstEncounterIndexValue;

						break;
					}
				}
			}
		}

		return result ?? "";
	}
}